import { useState } from 'react';
import React from 'react';
import * as style from './styles';
import TestCard from '../../components/TestCard/TestCard';
import { useNavigate } from 'react-router-dom';
import { Swiper, useSwiper } from 'react-fluid-swiper';

export default function Home() {
  const navigate = useNavigate();
  const { swiperProps } = useSwiper();

  return (
    <style.Container>
      <div onClick={() => navigate('/reactiontimetest')}>
        <TestCard title="test1" />
      </div>
      <div onClick={() => navigate('/sequencememorytest')}>
        <TestCard title="test2" />
      </div>
      <TestCard title="test3" />

      <Swiper {...swiperProps} className="my-swiper">
        <div onClick={() => navigate('/reactiontimetest')}>
          <TestCard title="test1" />
        </div>
        <div onClick={() => navigate('/sequencememorytest')}>
          <TestCard title="test2" />
        </div>
        <div>
          <TestCard title="test3" />
        </div>
      </Swiper>
    </style.Container>
  );
}
